import { useNavigate } from 'react-router-dom';

const HeaderHome = () => {


    return (
        <header>
            <nav>
                <Link to="/game">Play Game</Link>
                <Link to="/login">Login</Link>
                <Link to='/signup'>Signup</Link>
            </nav>
        </header>
    )
}

export default HeaderHome;
